import {Link} from "next/link";


class Nav extends Component {


    render = () => {
        return (
            <Fragment>
                        <Link as={'/'} href={'/'}>
                            <a>Hot</a>
                        </Link>
            </Fragment>
        )
    }
}

export default Nav;
